import React, { Component } from 'react';
import { ProductNotFound } from './StyledCart';

export default class Cart extends Component {
    render() {
        return(
            <ProductNotFound className="container-fuid">
                
                <div class="col-12">
                    <img src="Images/witcher.png" />
                </div>
        
            </ProductNotFound>        
        );
    }
}
